The AI tried to repeatedly use wrong versions for pulled docker images (e.g. bitnami/kubectl:v1.26.0);
When I tried to ask for different approaches for one case where I thought that the AIs approach was not good, it showed in its thought process that it should give me some information why its way is the best, but then didnt explained anything and just pushed its recommendet change;
In general it worked well as I have newer created a new CI CD pipeline from scratch.
